script: |
  super -f text -I q12659.spq | sort > q12659.out

inputs:
  - name: q12659.spq
    data: |
      SELECT ALL - 97 + + col2 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE - CAST ( NULL AS INTEGER ) * + col2 * 40 NOT BETWEEN ( - + 88 + - - col0 ) AND - col2;
  - name: tab0

outputs:
  - name: q12659.out
    data: |
